net.use(mse, mse_prime)

DIRS = {
    "N":(0, -1),
    "NE":(1, -1),
    "E":(1, 0),
    "SE":(1, 1),
    "S":(0, 1),
    "SW":(-1, 1),
    "W":(-1, 0),
    "NW":(-1, -1)
}

while input():
    #
    # Prediction (remember that the model was trained with normalized positions, so that's why it's divided / WIDTH)
    # 
    out = net.predict(np.array([sx/WIDTH, ix/WIDTH, sy/WIDTH, iy/WIDTH]).reshape(1,1,4))

    #
    # Find the neuron with the max activation level : this is the direction to go 
    #
    index = np.argmax(out[0][0])

    #
    # Output the solution
    #
    print(list(DIRS)[index])

    #
    # Move the player to the corresponding direction
    #
    vx, vy = list(DIRS.values())[index]
    ix += vx
    iy += vy